children.defaultValue:
 [
  provide(AuthOptions, {
    useFactory: (environmentService:EnvironmentService) => {
      var ACTIVE_ENVIRONMENT:EnvironmentModel = environmentService.getActiveEnvironment();
      return new AuthOptions(ACTIVE_ENVIRONMENT.providerUrl, ACTIVE_ENVIRONMENT.gatewayUrl, ACTIVE_ENVIRONMENT.userInfoEndPoint, ACTIVE_ENVIRONMENT.clientId, ACTIVE_ENVIRONMENT.scope);
    },
    deps: [EnvironmentService]
  }),
  HTTP_PROVIDERS,
  provide(TokenService, {
    useFactory: () => new TokenService()
  }),
  provide(UserService, {
    useFactory: (http:Http, authOptions:AuthOptions, tokenService:TokenService) => new UserService(http, authOptions, tokenService),
    deps: [Http, AuthOptions, TokenService]
  }),
  provide(AuthService, {
    useFactory: (gatewayService:GatewayService, tokenService:TokenService, options:AuthOptions, userService:UserService) => new AuthService(gatewayService, tokenService, options, userService),
    deps: [GatewayService, TokenService, AuthOptions, UserService]
  }),
  provide(GatewayService, {
    useFactory: (http:Http, tokenService:TokenService, options:AuthOptions, userService:UserService) => new GatewayService(http, tokenService, options, userService),
    deps: [Http, TokenService, AuthOptions, UserService]
  })
]

arguments.mapper:
(resp:any ) => {
    return resp.content.sort( ( a:StateBase, b:StateBase )=> {
        if ( a.name < b.name )
        return -1;
        else if ( a.name > b.name )
        return 1;
        else
        return 0
      });
  }

( resp:Pageable<Array<AddressBase>> ) => {
    let addresses:Array<AddressBase> = [];
    resp.content.forEach( address => {
      addresses.push( new AddressBase( address ) )
    } );
    return addresses;
  }
